The following example code defines and uses a boolean function is_prime() that determines whether or not an integer is prime. A prime number is an integer bigger than 1 that is divisible only by 1 and itself. def is_prime(number: int) -> bool: """ A function that determines whether or not a number is prime parameters: number: a positive integer greater than 1 (type int) return: True if number is prime, False otherwise (type bool) """ # tester is a possible factor. Start at 2 and we will increase it tester = 2 while tester < number: if number % tester == 0: # We know the answer, so the function teriminates # returning the result return False else: tester += 1 # We only reach this line if no return False above every occurred. # This means that the number has no factors and thus it is prime return True def main(): # The user inputs an integer and we determine if it is prime num = int(input("Enter an integer to test for primality: ")) if is_prime(num): print(f"{num} is prime") else: print(f"{num} is not prime") # Run the program:
if __name__ == '__main__': main() Key points: The input for this function is an integer. The output is a boolean (True if number is prime, False otherwise). It's helpful for boolean functions to have names that reflect that they return a True/False result. Here, is_prime() reads like a question that has a yes/no answer. When we call the function, the line if is_prime(23): makes sense when we read it. A function should only perform one task. Here, the job is to determine whether or not the number is prime. The function does not output the result to the console. The function just returns the result to the line that invoked it. It's up to the caller to interact with the user. This philosophy makes for more flexible and reusable functions. Within the loop of the is_prime() function, we can only return False, never True. Because only by completing the entire loop can we know that number has no factors (other than 1 and itself). The return True can thus only happen after the loop has completed. By placing the code to determine whether a number is prime into a separate function, we can now re-use it in multiple ways. For example, here is a new main() function that outputs all primes less than 1000: def main(): # Output all primes less than 1000, testing each number one by one for i in range(2, 1000): if is_prime(i): # output the number if it is prime: print(i, end = " ") # Move output to a new line print() You should notice how simple it was to create this new program. The is_prime() function did not need to be rewritten or even thought about. Here is yet another example. This time we will build another layer on top of the is_prime() function by creating a function called next_prime() to give the next prime larger than a specific integer. Notice that next_prime() itself uses is_prime(), so its job is made straightforward and easy to understand. By the use of these two functions, the interface with the user in main() is also very straightforward. This organization and structure makes code easier to read and understand, easier to fix if it has an error, and easier to enhance or modify if we choose to later. Notice that I've taken out the contents of is_prime() since that function is identical to before. def is_prime(number: int) -> bool: # contents not shown - it's unchanged from before! def next_prime(number: int) -> int: """ Return the first prime greater than or equal to number parameters: number: input value for which we need to return the next prime (type: int) return: a prime value greater than or equal to number (type: int) """ # start from number, and increment until we find the next prime while not is_prime(number): number += 1 # The loop has terminated, so the current value of number must be the next prime. return number def main(): n = int(input("Give me a number and I will tell you the next prime: ")) print(f"The next prime is {next_prime(n)}") # Run the program:
if __name__ == '__main__': main()

