The example below draws a circle at a random location on a 400x400 pixel dudraw canvas, with the default [0, 1]x[0, 1] scale, a radius from 0.05 to 0.1 and with a random color. A possible output image is shown. Code demonstrating use of random `float` and `int` numbers Image import random
import dudraw def main(): # Set up the canvas, 400x400 pixels dudraw.set_canvas_size(400,400) # Background light gray dudraw.clear(dudraw.LIGHT_GRAY) # Pick two random values from the interval [0,1] # for the center of the circle. x_center = random.random() y_center = random.random() # Random from 0.05 up to 0.1 for the radius radius = random.uniform(0.05, 0.1) # three values from 0-255 (inclusive) for the rgb color red = random.randint(0,255) green = random.randint(0,255) blue = random.randint(0,255) # Set pen color then draw the circle dudraw.set_pen_color_rgb(red, green, blue) dudraw.filled_circle(x_center, y_center, radius) # Display the result for 10 seconds dudraw.show(10000) # Run the program:
if __name__ == '__main__': main()
